import { useContext, useEffect, useState } from "react";
import "./App.scss";
import Provider, { DataContext } from "./context/DataContext";
import SearchPage from "./pages/SearchPage";

function App() {
  const [userValue, setUserValue] = useState("");
  const { getData, isLoading } = useContext(DataContext);

  const dataProps = {};
  useEffect(() => {
    getData();
  }, []);
  return (
    <Provider {...dataProps}>
      <div className="App">
        <SearchPage {...dataProps} />
      </div>
    </Provider>
  );
}

export default App;
